  <script>
    ///MAP
    const keyItems = document.getElementsByClassName("KeyItem");
    const popup = document.querySelector(".popup-description-box");
    const closeBtn = document.getElementById("popup-close-icon");
    //const outputElement = document.getElementById("info");
    const overlay = document.getElementById("overlay");

    const initialCard = document.getElementById("initialCard");

    overlay.addEventListener("click", (e) => {
      popup.style.visibility = "hidden";
      popup.style.opacity = "0";
      document.getElementById("overlay").style.display = "none";
    });

    popup.addEventListener("focusout", (e) => {
      //console.log("FOCUSOUT");
    });

    const smallDevice = window.matchMedia("(min-width: 820px)");

    smallDevice.addListener(handleDeviceChange);

    function injectContent(currentFtureID) {
      //console.log(currentFtureID);
      if (currentFtureID === "HybridPos") {
        popup.querySelector("#title").innerText = "Hybrid POS";
        popup.querySelector("#popup-text").innerText =
          "The evolution of the POS system. Order Chimps combines the best of the new technologies with the reliable ones. Bring the best of both worlds to your operations by syncing onsite and online orders on the same display.";
      } else if (currentFtureID === "ClickNCollect") {
        popup.querySelector("#title").innerText = "Click & Collect";
        popup.querySelector("#popup-text").innerText =
          "Encourages the use of the online ordering system, which assists your business to grow and ncrease your customer base, bringing e-commerce directly to your website.";
      } else if (currentFtureID === "CustomerLoyalty") {
        popup.querySelector("#title").innerText = "Customer Loyalty";
        popup.querySelector("#popup-text").innerText =
          "Automatically enroll customers through the POS platform by promoting and rewarding regular engagement. Connect all services to earn reward points.";
      } else if (currentFtureID === "MobileTableOrdering") {
        popup.querySelector("#title").innerText = "Mobile Table Ordering";
        popup.querySelector("#popup-text").innerText =
          "There is nothing to learn and nothing to Install! Your customers won't have to wait as long for their food, and you can focus on your other customers. Increase your orders and maximise your profits.";
      } else if (currentFtureID === "Reservation") {
        popup.querySelector("#title").innerText = "Reservation";
        popup.querySelector("#popup-text").innerText =
          "Your business will provide better service by better managing workflow through reservations from online and offline sources. This will also help better forecast demand, improve sourcing and staffing, and reduce costs in the long run.";
      } else if (currentFtureID === "EmailMarketing") {
        popup.querySelector("#title").innerText = "E-mail Marketing";
        popup.querySelector("#popup-text").innerText =
          "Using your existing business data on the platform, create a digital marketing strategy to help grow your business and customer base without spending more time and money on third party services.";
      } else if (currentFtureID === "SocailMedia") {
        popup.querySelector("#title").innerText = "Social Media Marketing";
        popup.querySelector("#popup-text").innerText =
          "Harness social media to elevate your business by targeting potential customers to grow your business and to create increased awareness.Using a results based approach,make bespoke strategies that align best with your business.";
      } else if (currentFtureID === "DigitalMenu") {
        popup.querySelector("#title").innerText = "Digital Menu";
        popup.querySelector("#popup-text").innerText =
          "Allows you to easily update content as frequently as you wish while highlighting important information to your customers. It also allows you to highlight promotions and up sell.";
      } else if (currentFtureID === "GiftVouchers") {
        popup.querySelector("#title").innerText = "Gift Vouchers";
        popup.querySelector("#popup-text").innerText =
          "Increase brand awareness, enable more customer engagement and grow your customer base. Introduce cash flow positive marketing to your usiness.";
      } else if (currentFtureID === "DeliveryGuy") {
        popup.querySelector("#title").innerText = "Delivery";
        popup.querySelector("#popup-text").innerText =
          "Enable delivery and expand your business. Enjoy a zero commission based model, where you get to keep your profits.";
      } else if (currentFtureID === "IpadOrdering") {
        popup.querySelector("#title").innerText = "Tableside Ordering";
        popup.querySelector("#popup-text").innerText =
          "Take down tableside orders on the iPad, cut down on manual input mistakes, and order ake-down times. Plus with the ability to see item information and availability, servers can offer better service to customers.";
      } else if (currentFtureID === "MobilePayments") {
        popup.querySelector("#title").innerText = "Mobile Payments";
        popup.querySelector("#popup-text").innerText =
          "Accept payments from customers instantly, saving them time. Empower your Customers  to order tableside and pay with their own device.";
      }else if (currentFtureID === "MealsDealsNPlans") {
        popup.querySelector("#title").innerText = "Meal Deals & Subscriptions";
        popup.querySelector("#popup-text").innerText =
          "Create a steady income stream and boost sales efficiency while creating more loyal customers by offering them deals and subscription plans.";
      }
    }

    function handleDeviceChange(e) {
      if (e.matches) {
        //outputElement.textContent = "Bigger Than Mobile";

        for (const item of keyItems) {
          const handleMouseEnter = (e) => {
            
            //INITIAL CARD HIDE
            initialCard.style.display = "none";

            item.querySelector(".circle-border").style.stroke = "#ffb627";
            let x = e.clientX;
            let y = e.clientY;
            popup.style.visibility = "visible";
            popup.style.opacity = "1";

            if (window.innerHeight - e.clientY < 300) {
              popup.style.top = y - 200 + "px";
            } else {
              popup.style.top = y + 20 + "px";
            }

            if (window.innerWidth - e.clientX < 400) {
              popup.style.left = x - 200 + "px";
            } else {
              popup.style.left = x + 20 + "px";
            }

            popup.querySelector("#title").innerText = "DESKTOP";

            //console.log(e.target.id);
            injectContent(e.target.id);

            // console.log("X AXIS ===========================");
            // console.log("CLIENT X", e.clientX);
            // console.log("WINDOW WIDTH", window.innerWidth);
            // console.log(window.innerWidth - e.clientX);
            // console.log("Y AXIS ===========================");
            // console.log("CLIENT Y", e.clientY);
            // console.log("WINDOW WIDTH", window.innerHeight);
            // console.log(window.innerHeight - e.clientY);
          };

          const handleMouseLeave = () => {
            //INITIAL CARD SHOW
            //initialCard.style.display = "block";

            popup.style.visibility = "hidden";
            popup.style.opacity = "0";
          };

          //remove all event listeners from item
          //item.replaceWith(item.cloneNode(true));
          item.addEventListener("mouseenter", handleMouseEnter);
          item.addEventListener("mouseleave", handleMouseLeave);
        }
      } else {
        //outputElement.textContent = "Mobile";

        const handleCloseBtnClick = () => {
          popup.style.display = "none";
          document.getElementById("overlay").style.display = "none";
        };

        closeBtn.addEventListener("click", handleCloseBtnClick);

        for (const item of keyItems) {
          const handleItemClick = (e) => {
            item.querySelector(".circle-border").style.stroke = "#ffb627";
            let x = 0;
            let y = 0;
            popup.style.display = "block";
            popup.style.visibility = "visible";
            popup.style.top = "50%";
            popup.style.left = "50%";
            popup.style.opacity = "1";
            document.getElementById("overlay").style.display = "block";

            let currentFtureID = "";
            const parent = e.target.parentNode;
            if (!parent.classList.contains("KeyItem")) {
              const grandParent = parent.parentNode;
              if (!grandParent.classList.contains("KeyItem")) {
                const lateGrandParent = grandParent.parentNode;
                currentFtureID = lateGrandParent.id;
              } else {
                currentFtureID = grandParent.id;
              }
            } else {
              currentFtureID = parent.id;
            }

            injectContent(currentFtureID);
          };
          //remove all event listeners from item
          //item.replaceWith(item.cloneNode(true));
          item.addEventListener("click", handleItemClick);
        }
      }
    }

    // Run it initially
    handleDeviceChange(smallDevice);
    function showPopup() {
        popup.style.display = "block";
        popup.style.position = "sticky";
        popup.style.visibility = "visible";
        popup.style.opacity = "1";
        popup.style.left = "150px";
        popup.style.top = "200px";
    }
