const queryString = window.location.search;
function parseQuery(queryString) {
    var query = {};
    var pairs = (queryString[0] === '?' ? queryString.substr(1) : queryString).split('&');
    for (var i = 0; i < pairs.length; i++) {
        var pair = pairs[i].split('=');
        query[decodeURIComponent(pair[0])] = decodeURIComponent(pair[1] || '');
    }
    return query;
}


const subjectFormSelector = document.getElementById(
        "form_subject_selector"
    );

  
    const querySubject = parseQuery(queryString)['subject'];

    const formOptions =[];
    for (const option of subjectFormSelector.options) {
      formOptions.push(option.value)
    }
    
    //console.log(formOptions);
    const optionIndex = formOptions.indexOf(querySubject);

    if (optionIndex > 0) {
      subjectFormSelector.options[optionIndex].selected = true;
      document.getElementById("contact_form").scrollIntoView();
      subjectFormSelector.focus();
    }



</script>
